const TabHeader = ({ mainText, subText, children }) => {
    return(
        <div>
            <div className='border-b border-stone-400   text-lg '>
                <div className='mt-5 ml-4'>
                    <h1 className='font-semibold text-3xl'>{mainText}</h1>
                    <p className='mb-4 mt-3 text-lg'>{subText}</p>
                </div>  
            </div>
            {children}
        </div>
    )
}

export default TabHeader;
